import React from 'react';
import { Box, MenuItem, Typography, Button, TextField, InputAdornment, Grid } from '@material-ui/core';
import { FormikHelpers, Formik, Form, Field, FieldProps } from 'formik';
import { ModelOTP } from './model';


const OTP = () => {
    return (
        <Box>
            <Box textAlign="left" padding="20px" marginTop="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box padding={"20px"}>
                <Box>
                    <Typography variant="h4" component="h4" >Let's get started!</Typography>
                </Box>
                <Box>
                    <Formik
                        initialValues={{
                            country: '',
                            phone: ''
                        }}
                        onSubmit={(
                            values: ModelOTP,
                            { setSubmitting }: FormikHelpers<ModelOTP>
                        ) => {
                            setTimeout(() => {
                                console.log(values, 'value----')
                                setSubmitting(false);
                            }, 500);
                        }}
                    >
                        {({ submitForm }) => (
                            <Form>
                                <Box margin={'20px 0px 20px 0px '}>
                                    <Grid container>
                                        <Grid item md={4}>
                                        </Grid>
                                        <Grid item xs={12} md={4}>
                                            <Field
                                                name='country'
                                            >
                                                {({
                                                    field
                                                }: FieldProps<ModelOTP>) => (
                                                    <TextField
                                                        value={field.value || ''}
                                                        onChange={field.onChange}
                                                        name={field.name}
                                                        variant="outlined"
                                                        label="Country"
                                                        select
                                                        fullWidth
                                                        InputProps={{
                                                            startAdornment: <InputAdornment position="start">+65</InputAdornment>,
                                                        }}
                                                    >
                                                        <MenuItem value={10}>Ten</MenuItem>
                                                        <MenuItem value={20}>Twenty</MenuItem>
                                                        <MenuItem value={30}>Thirty</MenuItem>
                                                    </TextField>

                                                )}
                                            </Field>
                                        </Grid>
                                        <Grid item md={4}>
                                        </Grid>
                                    </Grid>
                                </Box>
                                <Box margin={'20px 0px 20px 0px '}>
                                    <Grid container>
                                        <Grid item md={4}>
                                        </Grid>
                                        <Grid item xs={12} md={4}>
                                            <Field
                                                name='phone'
                                            >
                                                {({
                                                    field
                                                }: FieldProps<ModelOTP>) => (
                                                    <TextField
                                                        value={field.value || ''}
                                                        onChange={field.onChange}
                                                        name={field.name}
                                                        variant="outlined"
                                                        label="Phone Number"
                                                        fullWidth
                                                    />
                                                )}
                                            </Field>
                                        </Grid>
                                        <Grid item md={4}>
                                        </Grid>
                                    </Grid>
                                </Box>
                                <Box>
                                    <Button
                                        variant="contained"
                                        color="primary"
                                        onClick={submitForm}
                                    >
                                        Submit
                                    </Button>
                                </Box>

                            </Form>
                        )}
                    </Formik>
                </Box>

            </Box>

        </Box >
    )
}

export default OTP;
